      | 365973 -> { ItemTypeData.id= 365973; name= "'Neo' Scout ak.0"; published= false; description= "The Scout dropsuit is a lightweight suit optimized for enhanced mobility, multi-spectrum stealth, and heightened awareness. Augmented joint servo motors give every movement extra speed and flexibility, while integrated friction and impact dampening materials reduce the overall sound signature.     Building on recent advancements in biotic technology, this suit incorporates an array of cardiovascular augmentations that are automatically administered to the user in battle, improving overall stamina and reducing fatigue.     When missions call for speed and stealth, situations in which heavily armored suits would be more of a burden than an advantage, a scout dropsuit is the best option. The enhanced mobility it provides makes up for its relatively low protection, and when combined with stealth technology modules, the scout suit is the obvious choice for infiltration, counter-espionage, and assassination."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366458 -> { ItemTypeData.id= 366458; name= "Republic Flaylock Pistol"; published= false; description= "The flaylock is a snub-nosed pistol designed to fire one-inch direct attack missiles. Typically, the weapon is armed with pack-loaded dumbfire or seeker missiles effective against infantry and armored targets, but is fully compatible with a broad range of missile types, making it one of the most versatile sidearm weapons on the battlefield.  Seeker missiles utilize pre-launch lock-on and rudimentary self-guidance to track designated targets, though finite propellant limits the practical engagement zone to short ranges. Although less effective against shielded targets, the tandem warhead allows penetration of armor layers before detonation, amplifying the effectiveness of the narrow fragment stream and maximizing each projectile’s lethality."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
