      | 48492 -> { ItemTypeData.id= 48492; name= "Wolf Dawn of Liberation SKIN"; published= true; description= "The Great Rebellion was the dawn of liberation for the Minmatar tribes that once lived almost entirely under the dominion of the Amarr. When the slave revolt broke out in 20 BYC (AD 23216), it stunned an Amarr Empire already reeling from the shock of their defeat by the Jovian fleet at the Battle of Vak'Atioth.    The Minmatar that rose up were quickly able to cut a swathe through the territories surrounding the Matari home worlds, aided by groups of free Minmatar who had long operated as guerilla fighters both planet-side and in space. The Minmatar Republic was founded by four of the great tribes and was invited to join in the foundation of CONCORD in 3 BYC. By the end of YC 111, the Nefantar, Starkmanir and Thukker Tribes had rejoined their Brutor, Krusual, Sebiestor and Vherokior brothers and sisters in the Minmatar's Tribal Republic."; marketGroupId= Some(2050); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 48589 -> { ItemTypeData.id= 48589; name= "Matari Word Calendar"; published= true; description= "Many Minmatar still speak Amarish as their first language, even more so since the return of the Nefantar and Starkmanir, and  Republic Matari  is considered an unsatisfactory reconstruction of the common language of the old Minmatar Empire. All tribes are concerned to address this cultural issue and wish to live and speak according to their true heritage.    (Though the suggestion from the Krusual that all Minmatar adopt their tribal language, which remains almost entirely intact due to the Krusual resistance, was politely declined by the other tribes when the Republic was founded.)    Due to these concerns, major efforts are underway within the Republic to recover what is possible of all historical tribal languages and dialects, so as to restore them for use in modern Minmatar tribal societies. This calendar comes from an industry born out of that sentiment. There's a new Matari word for each of the 1357 days of the Matar year!"; marketGroupId= Some(1661); groupId= 1194; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
