      | 49947 -> { ItemTypeData.id= 49947; name= "Paladin Yoiul Festival YC121 SKIN"; published= true; description= "The annual Yoiul Festival celebrates the closing of one year and the start of another in New Eden's universal calendar, as adopted by all the empires 121 years ago at the Yoiul Conference. CONCORD has long sponsored and celebrated the Yoiul Festival and over time it has been adopted and marked as a holiday across the four empires. It is particularly significant for those who make their living in space, whether aboard a spaceship or the many space installations of New Eden."; marketGroupId= Some(2024); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
